import React from 'react';
import Home from './components/Home.js';
import {Route, NavLink, HashRouter} from 'react-router-dom';
import { Layout, Menu } from 'antd';

const { Header, Content, Footer } = Layout;

function App() {
  return (
    <HashRouter>
       <Layout className="layout">
    <Header>
      <div className="logo" />
      <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
        <Menu.Item key="1"><NavLink to="/component/Home">Home</NavLink></Menu.Item>
        <Menu.Item key="2"><NavLink to="/stuff">Stuff</NavLink></Menu.Item>
        <Menu.Item key="3"><NavLink to="/contact">Contact</NavLink></Menu.Item>
      </Menu>
    </Header>
    <Content style={{ padding: '0 50px' }}>
            <Route path="/components/Home" component={Home}/>
      <div className="site-layout-content">Content</div>
    </Content>
    <Footer style={{ textAlign: 'center' }}>Ant Design Â©2018 Created by Ant UED</Footer>
  </Layout>
);

      </HashRouter>
  );
}

export default App;
